import React, { useState } from 'react';
import HomeOver from '../components/HomeOver';
import { Container } from 'reactstrap';

const Home = (props) => {

    const [loading, setLoading] = useState(true);

    setTimeout( () => {
        setLoading(false);
    },5200);

    return (
        <div className="home col-md-12">
            { loading
                ?
                    <Container>
                        <HomeOver />
                    </Container>
                :
                    <Container>
                        <h1>Prueba</h1>
                    </Container>
            }
        </div>
    );
};

export default Home;
